import React, { Component } from 'react';

class Header extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    render() { 
        return (           
        <header id="header">
        <span className="logo"><a href="index.html">Elegantic</a></span>
        <ul className="tools-nav tools-nav-mobile">
          <li className="items"><a href="cart.html"><span>2</span> Items, <strong>$599.00</strong></a></li>
          <li className="login"><a href="#">Login</a> / <a href="#">register</a></li>
        </ul>
        <div className="bar-holder">
          <a className="menu_trigger" href="#">menu</a>
          <nav id="nav">
            <ul>
              <li><a href="products.html">Suits</a></li>
              <li><a href="products.html">Coats</a></li>
              <li><a href="products.html">Jackets</a></li>
              <li><a href="products.html">Shirts</a></li>
              <li><a href="products.html">Shoes</a></li>
            </ul>
          </nav>
          <ul className="tools-nav">
            <li className="items"><a href="cart.html"><span>2</span> Items, <strong>$599.00</strong></a></li>
            <li className="login"><a href="#">Login</a> / <a href="#">register</a></li>
          </ul>
        </div>
      </header> );
    }
}

export default Header;
